function splitBytecode(bytecode) {
  bytecode = bytecode.trim();

  const lines = [];
  const firstLine = bytecode.slice(0, 10);
  lines.push(firstLine);

  const remaining = bytecode.slice(10); // Remove the first 10 characters
  for (let i = 0; i < remaining.length; i += 64) {
    lines.push(remaining.slice(i, i + 64));
  }

  return lines;
}

const bytecode = `

`.trim();

const lines = splitBytecode(bytecode);

console.log("Split Bytecode:");

lines.forEach((line, index) => {
  console.log(`Line --> ${line}`);
});
